import React, { useState } from 'react';
import Formulario from './components/Formulario';
import ListarSimulacoes from './components/Listagem';
import './App.css';

function App() {
  const [mostrarListagem, setMostrarListagem] = useState(false);

  const handleSubmit = (dadosFormulario) => {
    console.log('Dados do formulário enviados:', dadosFormulario);
    setMostrarListagem(true); 
  };

  const handleVoltar = () => {
    setMostrarListagem(false); 
  };

  return (
    <div className="App">
      <header className="App-header">
        <div className="layout-container">
          {mostrarListagem ? (
            <ListarSimulacoes onVoltar={handleVoltar} />
          ) : (
            <Formulario onSubmit={handleSubmit} />
          )}
        </div>
      </header>
    </div>
  );
}

export default App;
